import React from "react";
import "../../../Styles/Pages/Shop/ShopHeader.scss";
import ShopNavbar from "./ShopNavbar";

function ShopHeader() {
  return (
    <div className='shopHeader'>
      <ShopNavbar />
      <h1></h1>
    </div>
  );
}

export default ShopHeader;
